import React from "react";
import Header from '../../Partials/Driver/Header'




class Reservations extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            data:[]
        }
    }

    componentDidMount=()=>{
        this.fetchOffers()
    }
    fetchRes = async () => {
        const res= await axios({
          method: "GET",
          url: "http://127.0.0.1:8080/EJB-Client/APIv1.0/reservations/",
          headers: { "Content-Type": "Application/json"},
      })
        if(res.status===200 && res.data.con !== 0){
            let liste=[]
            for (let offer in res.data){
                console.log(res.data[offer].con)
                if(res.data[offer].con===parseInt(this.state.con)){
                    liste.push(res.data[offer])
                }
            }
            this.setState({
            data:liste,
            is_loaded: true
        })}
        else{
          this.setState({
            is_loaded: false
          })
          }
      }
    
    
    render() { 
        return ( 
            <div className="min-h-full">
            <Header />
            <header className="bg-white shadow">
            <div className="max-w-7xl mx-auto py-6 px-4 sm:px-6 lg:px-8">
                <h1 className="text-3xl font-bold text-gray-900">Reservations</h1>
            </div>
            </header>


            </div>
         );
    }
}
 
export default Reservations;
